<!doctype html>
<html>

<head>
  <meta charset="utf-8" />
</head>

<body>
  <script type="text/javascript" src="main.js"></script>
  <script type="module">
    var options = {
      print: (function () {
        return function (text) {
          text = Array.prototype.slice.call(arguments).join(' ');
          console.info(text);
        };
      })(),
      printErr: function (text) {
        text = Array.prototype.slice.call(arguments).join(' ');
        console.error(text);
      },
    };
    let wasmModule = await loadConstantsWasmModule(options);
    console.log("Loaded Constants Wasm");
    console.log(wasmModule.A);
    console.log(wasmModule.B);
    console.log(wasmModule.C);
    console.log(wasmModule.D);
    console.log(wasmModule.Foo_E);
    console.log(wasmModule.F);
    console.log(wasmModule.G);
    console.log(wasmModule.VERSION);
  </script>
</body>

</html>
